    "2016-07-27T23:00:08.625779",nt"name": "establishment-of-a-nesting-gadwall-population-at-iroquois-national-wildlife-refuge-progres-be35d",nt"isopen":
    false,nt"url": null,nt"notes": "The main goal of the project is to establish
    a nesting population of Gadwalls on the Iroquois National Wildlife Refuge by capturing
    ducklings by night-lighting on Montezuma National Wildlife Refuge and releasing
    them on Iroquois. Twelve ducklings were released in 1969, 9 in 1970 and 62 in 1971.
    There was no definite evidence of nesting by Gadwalls in 1970. In 1971 there were
    three known breeding pairs and one brood was observed. In 1972 there were at least
    seven breeding pairs and three broods were recorded. Due to Hurricane Agnes, Montezuma
    had no surplus gadwalls in 1972, so there were no releases made on Iroquois. Band
    returns from the 1971 releases proved that ducklings as young as Class 11-a were
    capable of surviving in the wild without a hen.",nt"license_title": "License
